    // Suppose we are comparing 3-bit numbers, requiring
    // that ABC <= XYZ.  Here is what we require:
    //
    // * It is false that A=1 and X=0.
    // * It is false that A=X, B=1, and Y=0.
    // * It is false that A=X, B=Y, C=1, and Y=0.
